Exercise
 QuestionSmart Pointers allow you to access the underlying pointer, but they don't make you do it very often.  However, it's common for those recently acquainted with smart pointers to ignore the overloaded operators out of either ignorance or a misplaced fear of performance degradation.  Change the following code using .get() to have a more natural syntax:
  std::unique_ptr pBar(new Bar);

  foo(*(pBar.get()));

  pBar.get()->x();

  if(pBar.get())
  {
    //Do some stuff...
  }

 SolutionClick to expandBecomes:
   std::unique_ptr pBar(new Bar);
-  foo(*(pBar.get()));
+  foo(*pBar);
-  pBar.get()->x();
+  pBar->x();
-  if(pBar.get())
+  if(pBar)
   {
     //Do some stuff...
   }


 QuestionWhen should .get() be used on a smart pointer?
 SolutionClick to expandUsually when code outside your control requires a raw pointer -- but not ownership of the pointer.  Herb Sutter has also argued that in modern code, a raw pointer may indicate that the caller should do nothing with ownership (i.e., don't delete it).  Our codebase probably isn't modern enough to allow this -- too many instances of raw pointers still conveying ownership..

 Questionunique_ptr::release has a similar signature to unique_ptr::get.  How is it different?
 SolutionClick to expandThat should be called when passing ownership of the pointer elsewhere.  For example, the GUI toolkit wxWidgets expects heap-allocated[^0] objects which it will delete once it's done using them.  release on unique_ptr means that unique_ptr will no longer hold that pointer, nor attempt to delete it -- otherwise it wouldn't be unique.  See the next training for gotchas when releasing unique_ptrs.

 QuestionIt would be possible to allow the following code to compile.  What could happen if shared_ptr or unique_ptr were changed to allow it?
void foo1(int*) {}

std::shared_ptr pInt(new int(5));
foo1(pInt);

 SolutionClick to expandFirstly, calling foo1 as shown will fail, since you can't implicitly convert shared_ptr to T*.  If such a conversion were added, foo1(pInt) would compile & work, but delete pInt; would merely compile -- delete would be called twice on that pointer.  (It would probably work until your software was unserviceable -- e.g., deployed on a satellite.  This is in keeping with software's reputation for being spiteful.)  Accidentally calling delete as shown could happen if you were trying to replace raw pointers with smart pointers in legacy code.

 QuestionIt would be possible to allow the following code to compile.  What could happen if shared_ptr or unique_ptr were changed to allow it?
std::unique_ptr pInt2 = new int(5);

 SolutionClick to expandThe previous code would require unique_ptr to be implicitly constructable from T*.  Suppose you had legacy code like this:
foo2(int* pInt)
{...}

...

int* pMyInt = new int(42);
foo2(pMyInt);
*pMyInt = 43;

Then, using shiny new smart_ptrs, you changed part, but didn't see the later code:
foo2(const std::unique_ptr& pInt)
{...}

...

int* pMyInt = new int(42);
foo2(pMyInt);
*pMyInt = 43; //Earth-shattering kaboom!

As designed, the compiler will produce an error in the second case.  It's still possible to have exactly these problems, but you need to go out of your way to get them.  Code should be written to protect against Murphy (accidental misuse), not Machiavelli (deliberate attempts to misuse) [^1].  (This is not speaking in reference to sanitizing user input, which you should usually assume to be dangerous.)

 QuestionThe following contains a mistake.  Fix it, and explain why it was wrong.
std::shared_ptr p1(new int(42));
std::shared_ptr p2(p1.get());

 SolutionClick to expandp1 and p2 will both attempt to delete the same pointer, without knowing the other exists.  A shared_ptr counts the number of pointers referencing the same pointer and deallocates that pointer once no one is referencing it.  With code like the previous, we get the following:
std::shared_ptr p1(new int(42));//p1 references the new pointer, reference count = 1
std::shared_ptr p2(p1.get());//p2 thinks it's the only guy looking at the pointer, reference count = 1
//(automatically called) p2.~shared_ptr() -- deletes the pointer in p2
//(automatically called) p1.~shared_ptr() -- Oops, p1's pointer was already deleted!

The correct way to ensure the reference counts are correct is to copy the shared_ptr, not just the underlying pointer:
std::shared_ptr p1(new int(42));//p1 references the new pointer, reference count = 1
std::shared_ptr p2(p1);//p2 references p1's pointer & p1's reference count, reference count = 2
//(automatically called) p2.~shared_ptr() -- decrements the reference count ( = 1 )
//(automatically called) p1.~shared_ptr() -- decrements the reference count to zero and deletes the pointer.


 QuestionThe following contains a mistake.  Fix it, and explain why it was wrong.
std::unique_ptr p3(new int[42]);

 SolutionClick to expandstd::unique_ptr will call delete on its pointer -- that means the pointer should be allocated using new.  If we want to use new[N], we should store it in std::unique_ptr, which will correctly call delete[].  Furthermore, it offers operator[] and disallows operator* & operator->, which makes it less awkward to index elements after the first.

 QuestionWhen would you use a unique_ptr versus a shared_ptr?
 SolutionClick to expandUse shared_ptr when you know that ownership of the pointer must be shared in more than one place.  Note that ownership == responsability to deallocate the pointer.
Use unique_ptr when you don't know that ownership of the pointer must be shared.

 QuestionSuppose you have a class which returns a pointer which the user may wish to store in a shared_ptr.  What type should you return?
 SolutionClick to expandReturn a unique_ptr to that type.  unique_ptrs are convertible to shared_ptrs, so returning a unique_ptr prevents memory leaks without restricting how that pointer is used later.
Returning a raw pointer instead would certainly work, but goes against, e.g., Scott Meyers's advice to "make interfaces easy to use correctly and hard to use incorrectly."  (See Item 18 of Effective C++.)

